import './App.css';
import MaxUV from './Components/MaxUV';
import Grid from '@mui/material/Grid';
import CurrentWeather from './Components/CurrentWeather'
import currentWind from './Components/CurrentWind';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div>
          <CurrentWeather/>
          <Grid>
          <MaxUV></MaxUV>
          </Grid>
          <currentWind />
        </div>
      </header>
    </div>
  );
}

export default App;
